  "translationLines": [
    {
      "lineNumber": 81891,
      "originalJapaneseLine": "「だが、今俺はお前と共にケイブリスを倒し、",
      "translatedEnglishLine": "\"But now, I will defeat Cavebris together with you,"
    },
    {
      "lineNumber": 81892,
      "originalJapaneseLine": "　ホーネットもすぽぽーんと救ってやる」",
      "translatedEnglishLine": "and also quickly rescue Hornet.\""
    },
    {
      "lineNumber": 81893,
      "originalJapaneseLine": "「俺様が動いたからには、",
      "translatedEnglishLine": "\"Now that I have acted,"
    },
    {
      "lineNumber": 81894,
      "originalJapaneseLine": "　もうこちらの勝利は確実だな！",
      "translatedEnglishLine": "our victory is certain!"
    },
    {
      "lineNumber": 81895,
      "originalJapaneseLine": "　がはははははははははははは！」",
      "translatedEnglishLine": "Gahahahahahahahaha!\""
    },
    {
      "lineNumber": 81896,
      "originalJapaneseLine": "「だから、お前もそんな顔するんじゃ……」",
      "translatedEnglishLine": "\"So, don't make a face like that...\""
    },
    {
      "lineNumber": 81897,
      "originalJapaneseLine": "「ば、ば、ば……」",
      "translatedEnglishLine": "\"Ba, ba, ba...\""
    },
    {
      "lineNumber": 81898,
      "originalJapaneseLine": "「ば？」",
      "translatedEnglishLine": "\"Ba?\""
    },
    {
      "lineNumber": 81899,
      "originalJapaneseLine": "「馬鹿ーーーー！」",
      "translatedEnglishLine": "\"Idiot----!\""
    },
    {
      "lineNumber": 81900,
      "originalJapaneseLine": "「そ、そんな甘いもんじゃないんだ！」",
      "translatedEnglishLine": "\"I-It's not that simple!\""
    },
    {
      "lineNumber": 81901,
      "originalJapaneseLine": "「ふんっ、もっと真面目に考えろ！」",
      "translatedEnglishLine": "\"Hmph, think more seriously!\""
    },
    {
      "lineNumber": 81902,
      "originalJapaneseLine": "サテラはぷりぷり怒って、",
      "translatedEnglishLine": "Satera got angry and huffed,"
    },
    {
      "lineNumber": 81903,
      "originalJapaneseLine": "ランスから顔を背けてしまった。",
      "translatedEnglishLine": "turning her face away from Rance."
    },
    {
      "lineNumber": 81904,
      "originalJapaneseLine": "だが、そのおかげで、",
      "translatedEnglishLine": "However, because of that,"
    },
    {
      "lineNumber": 81905,
      "originalJapaneseLine": "サテラの気持ちは確実に少しだけ軽くなっていた。",
      "translatedEnglishLine": "Satera's feelings had definitely lightened just a little."
    },
    {
      "lineNumber": 81906,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 81907,
      "originalJapaneseLine": "「そ、その……",
      "translatedEnglishLine": "\"Th-That...\""
    },
    {
      "lineNumber": 81908,
      "originalJapaneseLine": "　もしも、サテラを、その……",
      "translatedEnglishLine": "If you were to, um..."
    },
    {
      "lineNumber": 81909,
      "originalJapaneseLine": "　元気づけようと、し、してくれたのなら……」",
      "translatedEnglishLine": "try to cheer Satera up..."
    },
    {
      "lineNumber": 81910,
      "originalJapaneseLine": "「うっ……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 81911,
      "originalJapaneseLine": "「あ、あり、ありが……」",
      "translatedEnglishLine": "\"Th-Thank, th-thank you...\""
    },
    {
      "lineNumber": 81912,
      "originalJapaneseLine": "「なんだって？",
      "translatedEnglishLine": "\"What was that?"
    },
    {
      "lineNumber": 81913,
      "originalJapaneseLine": "　もっとハッキリ喋れ」",
      "translatedEnglishLine": "Speak more clearly.\""
    },
    {
      "lineNumber": 81914,
      "originalJapaneseLine": "「ううう、うるさい、馬鹿！",
      "translatedEnglishLine": "\"Uuuu, shut up, idiot!"
    },
    {
      "lineNumber": 81915,
      "originalJapaneseLine": "　なんでもない！」",
      "translatedEnglishLine": "It's nothing!\""
    },
    {
      "lineNumber": 81916,
      "originalJapaneseLine": "「ご、ごほんっ……！」",
      "translatedEnglishLine": "\"A-ACHOO...!\""
    },
    {
      "lineNumber": 81917,
      "originalJapaneseLine": "「とにかく！",
      "translatedEnglishLine": "\"Anyway!"
    },
    {
      "lineNumber": 81918,
      "originalJapaneseLine": "　ケイブリス派に所属する魔人は多い！」",
      "translatedEnglishLine": "There are many demons belonging to the Cavebris faction!\""
    },
    {
      "lineNumber": 81919,
      "originalJapaneseLine": "「おお、そうだ。",
      "translatedEnglishLine": "\"Oh, that's right."
    },
    {
      "lineNumber": 81920,
      "originalJapaneseLine": "　そういえばどんなんがいるんだ？」",
      "translatedEnglishLine": "By the way, what kind of ones are there?\""
    },
    {
      "lineNumber": 81921,
      "originalJapaneseLine": "「そうだな……",
      "translatedEnglishLine": "\"Let's see...\""
    },
    {
      "lineNumber": 81922,
      "originalJapaneseLine": "　軽く話しておこう」",
      "translatedEnglishLine": "I'll briefly explain.\""
    },
    {
      "lineNumber": 81923,
      "originalJapaneseLine": "サテラは居住まいを正し、ランスに向き直る。",
      "translatedEnglishLine": "Satera straightened her posture and turned to face Rance."
    },
    {
      "lineNumber": 81924,
      "originalJapaneseLine": "「まず、魔人ケイブリス。",
      "translatedEnglishLine": "\"First, the demon Cavebris."
    },
    {
      "lineNumber": 81925,
      "originalJapaneseLine": "　敵の総大将、サテラ達が倒すべき敵だ」",
      "translatedEnglishLine": "He is the enemy's supreme commander and the foe we must defeat.\""
    },
    {
      "lineNumber": 81926,
      "originalJapaneseLine": "「アホみたいに強いくせに、",
      "translatedEnglishLine": "\"He's ridiculously strong,"
    },
    {
      "lineNumber": 81927,
      "originalJapaneseLine": "　慎重で用心深い奴でな……",
      "translatedEnglishLine": "but cautious and careful..."
    },
    {
      "lineNumber": 81928,
      "originalJapaneseLine": "　近寄ることさえ難しい筈だ」",
      "translatedEnglishLine": "It should be difficult even to approach him.\""
    },
    {
      "lineNumber": 81929,
      "originalJapaneseLine": "「魔人ケイブリス……",
      "translatedEnglishLine": "\"Demon Cavebris..."
    },
    {
      "lineNumber": 81930,
      "originalJapaneseLine": "　向こうの大将ってわけだ」",
      "translatedEnglishLine": "So he's the enemy general.\""
    },
    {
      "lineNumber": 81931,
      "originalJapaneseLine": "「こいつだけ倒せれば話は楽なんだがな」",
      "translatedEnglishLine": "\"If only we could defeat this guy alone, things would be easier.\""
    },
    {
      "lineNumber": 81932,
      "originalJapaneseLine": "「分かっていると思うが、それは無理だ。",
      "translatedEnglishLine": "\"I think you understand, but that is impossible."
    },
    {
      "lineNumber": 81933,
      "originalJapaneseLine": "　魔人は何人も攻めてきているし、",
      "translatedEnglishLine": "Multiple demons are attacking,"
    },
    {
      "lineNumber": 81934,
      "originalJapaneseLine": "　待っている間に人類軍は潰れるぞ」",
      "translatedEnglishLine": "and the human army would be crushed if we waited.\""
    },
    {
      "lineNumber": 81935,
      "originalJapaneseLine": "「ふん、分かっとる。",
      "translatedEnglishLine": "\"Hmph, I understand."
    },
    {
      "lineNumber": 81936,
      "originalJapaneseLine": "　他の魔人はどんな奴がいるんだ？」",
      "translatedEnglishLine": "What kind of demons are the others?\""
    },
    {
      "lineNumber": 81937,
      "originalJapaneseLine": "「魔人カミーラ。魔人四天王の一人。",
      "translatedEnglishLine": "\"Demon Camilla. One of the Four Heavenly Kings of demons."
    },
    {
      "lineNumber": 81938,
      "originalJapaneseLine": "　ゼス永久牢に閉じ込められていたが……",
      "translatedEnglishLine": "She was imprisoned in the Zes eternal prison, but..."
    },
    {
      "lineNumber": 81939,
      "originalJapaneseLine": "　奪還されたらしい」",
      "translatedEnglishLine": "seems to have been rescued.\""
    },
    {
      "lineNumber": 81940,
      "originalJapaneseLine": "「魔人ケッセルリンク。魔人四天王の一人にして、",
      "translatedEnglishLine": "\"Demon Kesselring. Also one of the Four Heavenly Kings of demons,"
    }
  ]
}

